import React from 'react';

function CheckBox() {
  return (
    <label className="checkbox__wrapper">
      <input
        className="checkbox__switch"
        type="checkbox"
      />
      <span className="checkbox__switch-cover" />
      <span className="checkbox__text">Короткометражки</span>
    </label>
  );
}

export default CheckBox;
